                    engine: 'linkedin',
                    text: 'O Prof. Nailor Marques Jr. é uma referência no mundo educacional, com formação em Direito e Letras pela Universidade Estadual de Maringá e 31 anos de experiência em sala de aula. Diretor do Atelier de Redação por 28 anos e conselheiro executivo do Grupo Bellinatti Perez há 20 anos, ele também atua como consultor no Grupo Aval/Toledo Piza e foi consultor de vendas do Grupo Euphoria. Com quase 3.000 palestras e cursos ministrados no Brasil e no exterior, e autor de 32 livros, incluindo "Educação para a Felicidade" e "Sucesso com Inteligência", Nailor compartilha seu vasto conhecimento em cursos exclusivos.\n\nNa Progressus EAD, buscamos sempre a excelência, e com o Prof. Nailor Jr., você terá acesso a uma formação de altíssimo nível. Aproveite a chance de aprender com um dos maiores nomes da educação e potencialize sua carreira com nossos cursos de Feedback Assertivo e Comunicação Persuasiva. Prepare-se para evoluir! 🌟\n\n#comunicação #feedback #carreiras #educação #cursosonline #carreiradesucesso #cursoonline',
