                    engine: 'linkedin',
                    text: 'Join us this Wednesday, October 23rd at 7:30 AM at COP16 Colombia, where we will have the honor of hosting Dr. Makame, Director of the Department of Marine Conservation at the Ministry of Blue Economy and Fisheries, Zanzibar. His expertise in managing and conserving marine biodiversity in Marine Conservation Areas is essential for the sustainable growth of sectors like fisheries, aquaculture, and tourism. Dr. Makame holds a PhD in Environmental Science and is a senior lecturer at the State University of Zanzibar. \n\nZanzibar is home to over 500 coral species and 600 fish species, making it a crucial ecosystem for marine biodiversity in the Indian Ocean.\n\nBe part of the Campo Capital Focus Conference: Conservation and Biodiversity Solutions from the Colombian Pacific to Zanzibar Island at COP-16 on October 23rd at Banco de Bogotá, Cali, at 7:30 AM.\n\nRegister at https://proco16.com/ under the Environmental Justice and Human Rights category, and select the Campo Capital Biodiversity Conference session.\n\nDon’t miss it!\n\n\n#COP16 #Biodiversity #EnvironmentalJustice #Conservation #Orinoquía #CampoCapital #SustainableImpact #ClimateAction #RiparianEcosystems #Morichales #CommunityConservation',
