                    engine: 'linkedin',
                    text: 'Llegó la COP 16 de Biodiversidad... Y mi Cali bella es la anfitriona... ¡qué dicha y orgullo! Para quienes estarán desde mañana en #ZonaVerde les invitamos a "Orinoquia biodiversa: saberes y redes para su conservación". \n\nLa Orinoquia es la cuenca del río Orinoco, el tercero más caudaloso del mundo. Y sin esta región, no existirían la Amazonia ni los Andes, pero históricamente ha sido subvalorada, desconociendo su rol clave para el presente y el futuro del planeta. Con los invitadxs del SIRAP Orinoquia se conversará sobre “mitos y verdades” de la región, la relación entre cultura y naturaleza que allí tiene lugar, así como las oportunidades, los desafíos y el trabajo en redes de áreas protegidas y conservadas públicas y privadas. \n\nEste evento es organizado con el liderazgo de la Dirección Territorial Orinoquia de Parques Nacionales Naturales de Colombia y la FUNDACION YURUMIí, y cuenta con el apoyo de WWF Colombia, a través de los proyectos IKI Sabanas y Pastizales y GEF Orinoquia, además del Proyecto Biocarbono Orinoquia del Ministerio de Agricultura y Desarrollo Rural, y la Fundación Natura.\n\nRegístrense en https://proco16.com/ (busquen el evento como: “Las RNSC y otras estrategias de conservación”).\n\n🗓 Fecha: lunes 21 de octubre de 2024\n🕣 Hora: 5:00 pm - 7:30 pm \n📍 Lugar: Auditorio principal Banco de Bogotá, Carrera 3 # 8 - 13\n\nAllá nos vemos 😉\n#COP16 #Biodiversidad #Biodiversity #Orinoquia #Orinoco #OrinocoRiverBasin #ZonaVerde #SomosOrinoquia #TodosSomosSIRAPOrinoquia',
