                    engine: 'linkedin',
                    text: '📢 #RestaurandoNuestroFuturo estará presente en la COP16 Colombia con el panel: Jóvenes y Niñez: Pilares de un Futuro Sostenible y en Paz 🌍\n\nTe invitamos a compartir un espacio donde exploraremos cómo los jóvenes, niños y niñas son claves en la reconciliación y la construcción de un futuro sostenible y en paz. \n\nCinco líderes y lideresas ambientales y pacifistas de Morelia, Condoto, Pasto, Cali y Bogotá compartirán sus historias inspiradoras y su impacto positivo en sus comunidades. Acompáñanos para debatir cómo empoderar a las nuevas generaciones para liderar cambios positivos ante los desafíos globales. 🌱🤝\n\n🔹 Fecha: 31 de octubre\n🔹 Hora: 4:00 PM - 6:00 PM\n🔹 Lugar: Auditorio Principal, Banco de Bogotá, Cra. 4 #7-61, San Pedro, Cali\n\n¡Cupos limitados! No olvides inscribirte en el siguiente link para obtener el QR de acceso. Ten muy presente el nombre y la fecha del panel: https://proco16.com/ \n\n¡Te esperamos para vivir la paz con la naturaleza! #USAID_Colombia OIM Colombia #ACDIVOCA_Colombia ACDI/VOCA Fundación ACDI/VOCA LA-FAVLA #Libremente',
