                    text: 'La presidente ejecutiva de Acolgen, Natalia Gutiérrez, le hizo un llamado de atención al Gobierno por la crisis energética que enfrenta el país. En el marco del Congreso de Asoenergía, señaló que la situación es tan crítica que no hay margen de reserva ni para poner plantas en mantenimiento.⁠\n⁠\nAdemás, dejó en evidencia las consecuencias económicas que habría en caso de configurarse un apagón, dejando pérdidas similares a las de la pandemia.⁠\n⁠\nGutiérrez aseguró que en 2025 solo habrá espacio de 1% en la reserva del sistema eléctrico, lo que deja prácticamente sin margen energético al país, lo que sería prácticamente una sentencia de apagón.⁠\n⁠\n“Según el Banco de Bogotá, por hora, el país perdería más de $200.000 millones. De acuerdo con estudios de Fedesarrollo, podríamos estar perdiendo 1,5 puntos del PIB, son casi $24 billones. Tenemos que ponernos de acuerdo en lo que estamos de acuerdo, en los puntos de cuenta que nos hagan salir de esta coyuntura”, dijo Gutiérrez.⁠\n⁠\nLa presidente de Acolgen hace referencia al informe del equipo de investigaciones económicas del Banco de Bogotá, donde estiman que las pérdidas que tendría el país, si se da el racionamiento energético, oscilan entre $175.000 millones y $204.000 millones por hora de apagón. El rango se da dependiendo en qué hora se presente el recorte.⁠\n⁠\nLea la nota completa en el link de la BIO⁠\n⁠\n#apagon #energia #acolgen #bancodebogota',
