                    text: '🎉 ¡Agradecemos profundamente a todos nuestros socios, aliados y amigos que nos acompañaron en el cóctel de networking de China Chamber México! \n\nEspecialmente agradecemos la presencia de  la Sra. Dong Wei, Ministra Consejera de Comercio y Economía de la República Popular China en Los Estados Unidos Mexicanos. \n\nLa velada fue un espacio excepcional donde representantes de distintos sectores pudieron conectar, explorar nuevas oportunidades y fortalecer lazos de colaboración. Este tipo de encuentros nos recuerda la importancia de contar con un entorno amigable y profesional para ampliar nuestra red de contactos y crear relaciones significativas, impulsando con ello el desarrollo y las oportunidades comerciales entre México y China.\n\nChina Chamber México seguirá promoviendo este tipo de eventos que enriquecen y fomentan el crecimiento mutuo. ¡Gracias por ser parte de esta comunidad y por su constante apoyo para seguir fortaleciendo nuestros lazos!\n\nEDSA Consulting Asia IBS MONEX GRUPO FINANCIERO BHR México CIBANCO Intercam Banco DiDi Canon Mexicana Huawei HSBC Bank of China Korn Ferry World Trade and Investment Group Metis Global Aon ManpowerGroup México y Centroamérica Newmark Alestra China Mobile International Limited Mindray México',
