                    url: 'https://www.linkedin.com/posts/jpberthelemy_conozca-nuestro-informe-de-sostenibilidad-activity-7255737665419980800--cW_',
                    engine: 'linkedin',
                    text: 'El 21 de octubre, Banco Popular y de Desarrollo Comunal - Oficial presento su reporte de sostenibilidad 2023. En particular se recalco el trabajo que esta haciendo la institucion a traves de la construccion de su Plan de Accion de Genero. Esta institucionalizando la perspectiva de genero en todas sus practicas internas y sus operaciones de financiamiento.\n\nReducir las brechas de genero no se trata solo de un tema de derechos humanos sino tambien de un tema economico y de competitividad. Mas alla del resultado financiero, Banco Popular y de Desarrollo Comunal - Oficial busca generar impacto social, dandole de esa forma mas valor a su estrategia de sostenibilidad.\n\nAgence française de développement en Amérique Latine ha estado apoyando el banco en esa tarea a traves de una cooperacion tecnica dedicada a la elaboracion de ese Plan de Accion Genero y a su implementacion por venir. Gracias a Gina Carvajal y a todo el equipo del banco por premiar esa estrecha cooperacion entre Agence française de développement en Amérique Latine y Banco Popular y de Desarrollo Comunal - Oficial\n\nJulián García Aristizábal Heidy Ureña Mariana Deheza Alejandro Manriquez-Rangel Laura Sanchez Leon Felipe Korreales alexia levesque Gina C. Grow. Gender and Work.',
