                    engine: 'linkedin',
                    text: 'Nos unimos a la Universidad APEC  para anunciar la octava convocatoria del “Premio APEC al Periodismo Fotográfico”.\n\nNos honra respaldar esta iniciativa que, año tras año, reconoce los aportes del fotoperiodismo y su labor de análisis en el entorno social, documentando la realidad de nuestra sociedad a través de imágenes.\n\nDurante el evento, presentamos junto a la universidad el libro “Siete Años del Premio APEC al Periodismo Fotográfico”, que recopila las imágenes de los ganadores de los siete certámenes anteriores, celebrados desde el año 2017 hasta 2023. Esta publicación busca motivar a las nuevas generaciones de fotoperiodistas a continuar realizando esta importante labor.\n\nNuestro vicepresidente ejecutivo de Comunicaciones Corporativas, Reputación y Banca Responsable, el señor José Mármol, destacó la importancia de la fotografía periodística, la cual "es mucho más que capturar momentos; es una herramienta crítica para documentar la realidad, sensibilizar sobre temas medulares y generar conciencia social."\n\nAl estar presentes en este evento, reafirmamos nuestro apoyo al talento local y al fortalecimiento de una sociedad más justa, democrática y conectada con su identidad cultural. Agradecemos a APEC y a todos los profesionales que, con su lente, contribuyen a la construcción de un mejor futuro.\n\n#BancoPopularDominicano #60AñosCumpliendo #ElBancoDeLasIdeas #BancaResponsable',
