                    text: 'Profissionais com deficiência, participem da pesquisa de empregabilidade \n\n*Juntas e juntos por um futuro mais inclusivo* !\n\nA Talento Incluir,  o Instituto Locomotiva  o Pacto Global da ONU - Rede Brasil  a iO Diversidade  uniram forças para realizar um abrangente estudo sobre a inclusão de pessoas com deficiência no mercado de trabalho brasileiro.\n\nTer dados concretos sobre esse grupo é essencial para promover políticas eficazes, identificar barreiras e criar um ambiente de trabalho mais justo. Acesse o link da bio e responda, contamos com sua participação para entender o mercado e construir ainda mais oportunidades para profissionais com deficiência.\n \n *Acessar a pesquisa:* https://lnkd.in/g-MNZXSu \n \n *Acessar a pesquisa com videos em libras:* https://lnkd.in/g5Ve3mzn',
