                    id: 'DBOzERksRPa',
                    url: 'https://www.instagram.com/larepublica_co',
                    engine: 'instagram',
                    text: 'Ayer se realizó el foro del nuevo sistema de pagos Bre-B, un modelo que busca transferencias inmediatas e interoperables para disminuir el uso de efectivo y promover la bancarización. ⁠\n⁠\nAna María Prieto, directora del departamento de sistema de pagos del Banco de la República, recalcó en el foro de Bre-B que la tarifa será de $0 en los primeros tres años para las entidades financieras. “Una vez lleguemos al cuarto año, el cobro que será de $3,23 aplicable a cada punta, para un total de $6,46 por transacción a los sistemas de pagos de bajo valor”, dijo.⁠\n⁠\n¿Qué quiere decir esto? Significa que el Emisor durante tres años no le cobrará a los bancos por utilizar los servicios de infraestructura que va a ofrecer. Después de este tiempo, se aplicará una tarifa de $3,23 a cada punta (a la entidad que envía y a la que recibe) para un total de $6,46, pero, ¿habrá cobro a los usuarios?⁠\n⁠\n“Las entidades financieras podrían determinar si van a generarle un cobro a los clientes y de qué cuantía. Hoy por hoy ya tenemos varias entidades, o la gran mayoría en realidad, que tienen una tarifa cero para los pagos entre personas en el caso del sistema de pago Transfiya”, dijo Prieto. Lo que espera el Emisor es que, con este anuncio, se consolide esa gratuidad. Además, Prieto explicó a LR que estos cobros a los usuarios, de ser definidos por el banco, pueden aplicarse en cualquier momento, incluso desde el primer día.⁠\n⁠\nLea la nota completa en el link de la BIO⁠\n⁠\n#breb #bancodelarepublica #pagos #emisor #transfiya #davivienda #daviplata #aval #grupoaval #bbva',
