                    url: 'https://www.instagram.com/forbescolombia',
                    engine: 'instagram',
                    text: 'El miércoles 20 de marzo, quien ha sido el hombre más rico de Colombia por más tiempo dio un paso al costado. Luis Carlos Sarmiento Angulo, que posee una fortuna estimada por Forbes de US$7.200 millones, renunció a la Junta Directiva de Grupo Aval, después de años de haberla dirigido, la decisión hace parte de un plan de retiro que el magnate viene trabajando hace años.\n\nEl millonario de 91 años delegó a su hijo su puesto. En el marco de la Asamblea General de Accionistas, se presentó una lista de candidatos al cargo vacante conformada por nueve miembros, dentro de los cuales se incluyó a Luis Carlos Sarmiento Gutiérrez, lista que fue aprobada.\n\nLA ERA SARMIENTO ANGULO\n\nDurante años, el magnate estuvo al frente del conglomerado financiero que incluye al Banco de Bogotá, Banco de Occidente, AV Villas, el Banco Popular, el fondo de pensiones Porvenir, Corficolombiana y la billetera digital dale!, además estuvo a cargo de otras inversiones de la Organización Sarmiento Angulo dentro de las que se cuentan Seguros Alfa, El Tiempo y Construcciones Planificadas.\n\nEl empresario ejecutó una de las obras de filantropía más importante de la historia reciente de Colombia: el Centro de Tratamiento e Investigación del Cáncer (CTIC) cuya apertura tuvo lugar en 2022 y en el que invirtió 1$1,4 billones. Sarmiento Angulo también hizo otras contribuciones en los campos de la educación, la salud y la ayuda en casos de emergencia.\n\nPese a ser miembro de la lista de millonarios Forbes, Sarmiento Angulo nació en una familia de clase media, su primera empresa la empezó en una oficina con tres personas, su crecimiento fue orgánico y lleno de mucho trabajo. Hasta el día de su retiro, mucho después de la edad promedio de retiro en Colombia, este empresario trabajó de lunes a viernes desde las 8:30 a.m. a las 7:00 p.m., en su oficina, con traje y respondiendo muchas diligencias.\n\nFotos: @dianareymelo_photography, Claudia Rubio y Grupo Aval\n\nMás información en Forbes.co\n\n#GrupoAval #LuisCarlosSarmiento #EmpresariosColombianos',
