                    url: 'https://www.linkedin.com/posts/oscar-mauricio-echavarria-estrada-5a880080_una-reflexi%C3%B3n-de-un-cliente-com%C3%BAn-ya-que-activity-7251230642615521280-dx7_',
                    engine: 'linkedin',
                    text: 'Una reflexión de un cliente común ya que no sé de temas salvo evaluaciones de propuestas en diferentes juntas directivas y un emprendimiento empresarial que ya es una realidad\n\nDe verdad que es una excelente opción del Chatbot o Callbot para muchos en la vida de ser clientes con poco tiempo o mejor sin entusiasmo de esperar largo tiempo en una fila de un call center o peor tener que visitar una oficina muchas en las cuales hay agendamiento que no se respeta; pero regresando al tema de los chatbots creo que las marcas abusan y ya nos pasamos al otro lado donde la intuición del creador puede distanciarse en la diversidad de la los múltiples segmentos de clientes.\n\nIncluso algunos atrevidos piden dar palabras claves o preguntas ágiles para tratar de resolver muchas veces el problema del ya sufrido cliente que en muchas o la mayoría de las ocasiones recurre a la herramienta buscando una solución; pero creo que “pegarle” a la necesidad del cliente es cuestión de alta dosis de suerte, magia o casi poder de adivinación astral.\n\nDefinitivamente al final del ejercicio el cliente puede terminar creyendo que los “creativos” y los estrategas decidieron fue crear barreras para no resolver el problema y resignarse con el problema, pagar el extra costo que origina la búsqueda o súplica de ayuda o lo peor no poder tener más beneficios que la marca en su propuesta de valor puede tener.\n\nSiempre debe haber un conducto o camino para hablar y estoy seguro que si será una solución para seguir no viendo filas interminables en oficinas de atención al usuario con costos directos grandes pero enormemente gigantes en el valor de la marca que tarde que temprano pagará con estas barreras la fidelidad de sus clientes y la inversión para obtenerlos.\n\nClaro Empresas Colombia Movistar Empresas Colombia Juan Esteban Cock V. Luis Germán Quintero Mesa Maria Adelaida M. Alejandro Yepes avianca Tigo Colombia Bancolombia Seguros SURA Banco Davivienda Santiago Restrepo Bernal Carlos Felipe Muñoz Paredes Claudia Palacios Falck Sergio Martinez Marketing Mind',
