                    engine: 'linkedin',
                    text: 'Con mucha gratitud recibo el reconocimiento de Forbes Colombia como uno de los mejores CIOs de 2024. Este logro refleja el esfuerzo conjunto del talentoso equipo de Tecnología y Operaciones del Banco de Bogotá, que ha comenzado a transformar la manera en que entendemos y servimos a nuestros clientes.\n \nGracias al desarrollo de modelos de machine learning, hemos generado nuevas oportunidades de negocio que nos han permitido alcanzar un volumen marginal de $2.5 billones. Además, con la creación de un equipo especializado en inteligencia artificial generativa, contribuimos en 2023 al crecimiento del 26% de la cartera de consumo y del 11% de la cartera comercial.\nSeguimos comprometidos con liderar la innovación tecnológica para ofrecer productos y servicios que realmente marquen la diferencia en cada etapa del ciclo de vida de nuestros clientes. Este reconocimiento es un testimonio del poder de la tecnología para generar un impacto tangible y sostenible en el negocio. Agradezco a todos los colaboradores del Banco de Bogotá, ADL y el Grupo AVAL que forman parte de este gran logro.',
