                    text: '𝐏𝐚𝐮𝐬𝐚 𝐱 𝐌𝐨𝐯𝐢𝐦𝐢𝐞𝐧𝐭𝐨 = 𝐄𝐬𝐩𝐞𝐫𝐚 𝐀𝐜𝐭𝐢𝐯𝐚 => 𝐏𝐫𝐨𝐝𝐮𝐜𝐭𝐢𝐯𝐢𝐝𝐚𝐝\n\nEn los últimos días, vengo sintiendo incomodidad en esta “pausa” laboral. El ruido mental empezó a hacer lo suyo, ese que te dice que deberías estar haciendo más. \n\nAyer, hablando con Andrea Montoya Suárez, mi amiga y antropo partner, me dijo: “Es que el mandato de ser productiva es MUY fuerte”.\n\n🤯 No había reparado en eso, 𝐞𝐥 𝐦𝐚𝐧𝐝𝐚𝐭𝐨. Conozco la teoría de punta a punta. Sé que no siempre hay que estar haciendo, entregando o creando para marcar la diferencia. Pero eso no evitó que me sintiera rara. Así que hice una de las cosas que mejor sé hacer, desarmar juicios y transformar reflexiones en acción. Esto concluí:\n\n💡 𝐌𝐢 𝐩𝐚𝐮𝐬𝐚 𝐧𝐨 𝐞𝐬 𝐩𝐚𝐬𝐢𝐯𝐚. Estoy en 𝐦𝐨𝐯𝐢𝐦𝐢𝐞𝐧𝐭𝐨, lo que significa que estoy en una 𝐞𝐬𝐩𝐞𝐫𝐚 𝐚𝐜𝐭𝐢𝐯𝐚. Entonces, estoy siendo 𝐩𝐫𝐨𝐝𝐮𝐜𝐭𝐢𝐯𝐚 sólo que de una manera más orgánica y dedicada a invertir en mi desarrollo para cuando llegue la oportunidad adecuada.\n\n💡 𝐄𝐥 𝐫𝐮𝐢𝐝𝐨 𝐦𝐞𝐧𝐭𝐚𝐥 𝐦𝐞 𝐣𝐮𝐞𝐠𝐚 𝐞𝐧 𝐜𝐨𝐧𝐭𝐫𝐚. Nos medimos por lo que “producimos” según mandatos sociales. Sí, la teoría es clara, pero vivirlo es otra cosa. A veces, permitirse pausar puede ser el mayor acto de productividad. Escribir y desarticular esos pensamientos que aparecen en mi cabeza ha sido un gran recurso para apagar esa frecuencia que no sintoniza con lo que necesito.\n\n💡 𝐑𝐞𝐢𝐯𝐢𝐧𝐝𝐢𝐜𝐚𝐫 𝐥𝐚 𝐩𝐚𝐮𝐬𝐚 𝐞𝐬 𝐚𝐯𝐚𝐧𝐳𝐚𝐫. Valorar lo cíclico y los tiempos naturales, también es una forma de dirigirme hacia mi futuro. No todo tiene que ser visible para ser valioso. A veces, esa “productividad” que se ve puede ser, incluso, destructiva y puede poner en peligro la viabilidad de la vida en la Tierra. De eso habla Vandana Shiva en Unidad VS el 1%, mi lectura actual en esta espera activa.\n.\n.\n#Impactosocial #Desarrollo #Aprendizaje #Liderazgo #Voluntariado #Gestiondeltalento #Desarrollopersonal #Proposito #Empoderamiento #Talento #Transformaciónsocial #CulturaOrganizacional #Slowlife #Slowwork',
