                    url: 'https://www.linkedin.com/posts/alejandra-d%C3%ADaz-agudelo-95660313b_cop16-visiaejndavivienda-todosrespondemos-activity-7257550557505036289-ZXNO',
                    engine: 'linkedin',
                    text: 'En el dia 9 de la #COP16 Seguros Bolívar S.A. y Banco Davivienda fuimos anfitriones de 4 conversaciones poderosas con representantes de diferentes sectores de la economía, que tienen dependencias, impactos, riesgos y grandes oportunidades de la conservación de la biodiversidad y uso responsable. \n\nCon la intervención de Alvaro Carrillo  presidente de Seguros Bolívar S.A., se dio inicio a este espacio de diálogo, que fue la culminación de conversaciones virtuales que tuvimos durante tres meses, en lo que llamamos camino a la COP,  a través de la plataforma #VisiónDavivienda, donde hablamos de economía y finanzas relacionadas con nuestra riqueza natural\n\nEn el primer panel sobre construcción, tuvimos la presencia de la señora Ministra Helga María Rivas Ardila, del Ministerio de Vivienda, Ciudad y Territorio, Guillermo Herrera - Camacol, Marcela Ponce Perez de la IFC - International Finance Corporation, María Isabel Cárdenas B de Cementos Argos y Angelica M. Ospina Alvarado del Consejo Colombiano de Construcción Sostenible (CCCS), como panelistas. Del panel moderado por Javier Suárez presidente de Banco Davivienda, destaco el llamado de la ministra a la construcción de habitats que coexistan con la naturaleza y el bienestar de las personas.\n\nEn el panel de agricultura, moderado por ALEJANDRO SANTOS RUBINO, el presidente de Colombina, @cesar caicedo Jaramillo, Alexandra Restrepo García, de FINAGRO, German Bahamon J. De La Federación Nacional de Cafeteros de Colombia y Ricardo Uribe Lalinde de Cartama, hablaron de la agricultura que conserve y regenere como puerta de acceso a mercados. \n\nEn el panel de salud Rafael González Molina de Clínica Imbanaco, Marcela Granados Valle del Lili, Catalina L. de Roche y Vicente Duran de Pontificia Universidad Javeriana Cali, moderado por Daniel Humberto Echeverri Garcia de ProPacífico, evidenciaron los impactos que la  alteración que los servicios  ecosistémicos tendrá sobre la salud y los costes del sistema. \n\nCerramos con un panel moderado por Ana Fernanda Maiguashca, con Harold Eder de Manuelita, Maria Adelaida Arango Hoyos de Nutresa, Claudia Marcela Betancur Giraldo de BIOINTROPIC y Catalina Giraldo Valencia de Organización Carvajal, quienes compartieron casos inspiradores de cómo desarrollan sus industrias en armonía con la naturaleza y sacando provecho responsable de la biodiversidad.\n\nEn Seguros Bolívar S.A. creemos que cuando se trata de contener el deterioro de nuestro capital natural #TodosRespondemos y en Banco Davivienda no paramos de dar #LoraPorLaBiodiversidad\n\nUn millón de gracias a todas personas que en ambas compañías lo hicieron posible.',
