                    engine: 'linkedin',
                    text: 'Hace poco tuve la oportunidad de vivir una experiencia enriquecedora en la "Semana Internacional de Salud" en la Universidad de los Andes en Colombia, dedicada a la "Inmersión en un sistema de 30 años de construcción en gestión de riesgos en salud y la situación de coyuntura en Colombia". Durante estos días, cada ponencia dejó lecciones profundas sobre el papel de la generosidad, el compromiso social y la importancia de una gestión eficiente en salud.\nUno de los momentos más impactantes fue la charla de IGNACIO, quien enfatizó cómo los médicos voluntarios y serumistas, quienes se han formado en manejo de desastres y liderazgo comunitario. Este espíritu de servicio no solo aporta a la salud pública, sino que crea una red de líderes generosos comprometidos en compartir alegrías en sus comunidades. También quedó claro el rol fundamental de las universidades en transferir conocimientos con un compromiso social auténtico, y en crear alianzas que construyan un sistema más resiliente y equitativo.\nAdemás, aprendimos sobre el deber de las instituciones de salud de cumplir su propósito desde una perspectiva que respete la dignidad del paciente, implementando modelos de gobernabilidad que garanticen la calidad y seguridad en cada paso del proceso. Hablamos de la Atención Primaria de Salud (APS) y cómo este enfoque permite que cada persona y familia cuente con un equipo de salud cercano, en quien puedan confiar y que los apoye en su camino hacia el bienestar.\nTambién fue valiosa la visita a la Fundación Santa Fe de Bogotá y a la Fundación CTIC, Centro de Tratamiento e Investigación sobre Cáncer Luis Carlos Sarmiento Angulo, que impulsan modelos integrales centrados en el paciente y el trabajador, con un enfoque en la ciberseguridad de los datos y gestión integral de riegos, recordándonos que cada aspecto, desde el humano hasta el tecnológico, es esencial para la salud moderna.\nAgradecido por este aprendizaje, y con una renovada visión sobre lo importante que es la generosidad y la colaboración en la salud.\nMi agradecimiento profundo al Dr. Alvaro Muñoz Escobar que con su acompañamiento de todos los días en cada tema nuevo que aprendíamos con los profesionales destacados: Alexander Gomez, Luis Eduardo Moreno, Luis Jorge Hernández, Eduardo Castano, Carlos Gutiérrez, Andrés Contreras, Carlos Augusto Lopez-Saldarriaga, María Fernanda Campos\ny gracias ESAN Graduate School of Business y la Universidad de los Andes - Colombia por haberlo hecho posible.',
