                    engine: 'linkedin',
                    text: 'El día de ayer, fue un día de muchas emociones y aprendizajes, se llevó acabo el evento más esperado del año, para los empleados del grupo Aval, los premios #yosoyaval, fui feliz de escuchar la entrevista a Luis Carlos Sarmiento Gutiérrez, me llevo una gran frase de negociación cómo lo es “Nada está negociado, hasta que todo esta negociado”, de cómo saber entender lo que quiere mi contraparte y aprovechar esto deseo dentro de la negociación, \npor otro lado me encanto ver cómo está dentro del Mindset de nuestros lideres que el cliente se encuentre en el centro de todo y que el propósito del grupo este enfocado en crear experiencias memorables para ellos.\nQue gran noche, el simple hecho de estar allí y estar nominado como una persona gestora de cambios que ayudan a la sostenibilidad y el medio ambiente, me hincha el corazón de orgullo, gracias #grupoAval y #bancodebogota por una noche inolvidable',
