                    url: 'https://www.linkedin.com/posts/grupoaval_recap-yo-soy-aval-2024-activity-7257505126154661888-qgxH',
                    engine: 'linkedin',
                    text: 'Ayer vivimos el día #YoSoyAval2024: Historias que construyen grupo, una jornada llena de emociones donde celebramos y reconocimos el esfuerzo, la pasión y el compromiso de quienes, con su trabajo diario, aportan a la historia de nuestro conglomerado.\n \nLa jornada estuvo llena de momentos inolvidables: \n1. Palabras inspiradoras de nuestra Presidente, Maria Lorena Gutierrez.\n2. Entrevista y reconocimiento a Luis Carlos Sarmiento Gutiérrez, presidente de la Junta Directiva, por su liderazgo y aporte al crecimiento de nuestro holding.\n3. Jonathan Loidi, nos motivó con su energía y visión en la charla: Los secretos detrás de la magia.\n4. Historias que construyen grupo presentado por nuestra Presidente, Maria Lorena Gutierrez.\n5. Tuvimos el panel liderado por Paula Durán, Vicepresidente Corporativa de Sostenibilidad y Proyectos Estratégicos, Experiencias que trascienden: Nuestro impacto en cada historia.\n6. Entrega de los reconocimientos Soy Aval a los colaboradores más destacados de cada entidad del grupo. En diversas categorías, estos fueron los reconocimientos individuales de Grupo Aval:\n\nColaboración y trabajo en equipo: Dany Trujillo\nEmpatía y conexión humana: Claudia Tovar\nSostenibilidad e impacto social: Luisa Rodríguez\nInnovación centrada en el cliente: Katherin Osorio\n \nAdemás, compartimos momentos de alegría con rifas, incluyendo boletas para el concierto de Shakira. La jornada cerró con un cóctel en el que celebramos el compromiso que nos une como holding financiero.\n\nGracias a cada uno de nuestros colaboradores por ser parte de esta historia. Su esfuerzo hace la diferencia, fortalece los lazos que nos unen como grupo y nos impulsa hacia un futuro más sólido.\n \nHacemos grupo con nuestros colaboradores, hacemos grupo con todo el país. 🇨🇴\n\nBanco de Bogotá, Banco de Occidente, Banco Popular Colombia, Banco AV Villas, Corficolombiana, Porvenir Pensiones y Cesantías, dale!, ADL Digital Lab A Toda Hora S.A (AVC)',
