                    text: 'Ayer celebramos el día #YOSOYAVAL2024, un espacio maravilloso para reflexionar sobre las cosas que realmente nos importan como Grupo: la construcción de país y cómo fortalecemos nuestra cultura para que sea realmente centrada en el cliente.\n\nTuvimos el honor de escuchar a Luis Carlos Gutiérrez Sarmiento Gutiérrez, quien compartió con todos los colaboradores del Grupo, experiencias inspiradoras de su vida como líder empresarial.\n\nTambién tuvimos el orgullo de premiar a las personas más destacadas en cada una de las entidades de nuestro querido Grupo Aval.\n\nPara mí fue muy emocionante presentar a #CarlosDurango, a Judy Andrea Pita R. a Jeison Andres Palacios Raquira  y Fabian Onofre Gutierrez Bonilla, como ganadores, dentro de un grupo de 12 nominados en Aval Valor Compartido - AVC (antes A Toda Hora S.A),  quienes son ejemplo para todos nosotros de los comportamientos que esperamos como colaboradores de AVC y del Grupo Aval.\n\nGracias Maria Lorena Gutierrez por ser esa líder que con cada palabra nos deja reflexiones importantes para ser mejores personas que contribuyen a la construcción de un mundo mejor para todos.\n\nGracias a Paula Durán y su equipo quienes hicieron posible #YOSOYAVAL2024.',
