                    engine: 'linkedin',
                    text: 'On Saturday, we joined the convening of stakeholders to discuss the regional challenges surrounding #biodiversity and nature in Latin America and The Caribbean.\n\nCambria Allen Ratzlaff spoke at the event: ‘What we need is a sustainable finance system that is truly sustainable…. the interests of long-term, patient capital and nature are intertwined, and aligned.’\n\nThe event was hosted by PRI, alongside CDP, Climate Bonds Initiative - Latin America, Glasgow Financial Alliance for Net Zero (GFANZ), Global Reporting Initiative (GRI), High-Level Climate Champions, UNDP and United Nations Environment Programme Finance Initiative (UNEP FI).\n\nThroughout the day, it became clear that a regional perspective is required that provides a comprehensive understanding of Latin America & The Caribbean, analysing biodiversity and ecosystems as elements that transcend territorial boundaries and with transversal needs.\n\nIt is clear that we need to put nature at the centre of economic development in the present and in the future. 🦎 🦋 🌹 \n\nSuperintendencia Financiera de Colombia\nCésar Prado Villegas\nBrigitte Baptiste\nHilen G Meirovich\nJuan David Correa Solorzano\nJavier Suárez',
