                    engine: 'linkedin',
                    text: '#Sostenibilidad En el marco de la COP16, se celebró el Día de las Finanzas y la Biodiversidad en América Latina y el Caribe, un evento paralelo enfocado en movilizar recursos financieros para la conservación de la biodiversidad. Este encuentro resaltó la importancia de alinear los flujos de inversión con los objetivos del Marco Global de Biodiversidad, destacando la necesidad de colaboración entre el sector financiero y las iniciativas de protección ambiental.\n\nCésar Prado Villegas, presidente del Banco de Bogotá, enfatizó en la urgencia de ampliar los esfuerzos financieros más allá del cambio climático. “Colombia tiene grandes oportunidades en biodiversidad. Controlar nuevas emisiones y capturar carbono depende de proteger y restaurar nuestros ecosistemas,” afirmó Prado, destacando la interconexión entre la sostenibilidad ambiental y la estabilidad económica.',
