                    text: '🎤 Ο @ethismos_ath στο νέο του κομμάτι με τίτλο «Errico\'s Freestyle» αναφέρθηκε στην Παλαιστίνη και όχι μόνο.⁠\n⁠\n🇵🇸 Ενώ η γενοκτονία στην Παλαιστίνη συνεχίζεται και αθώες ζωές χάνονται, η μουσική βιομηχανία σπάνια θίγει αυτό το ζήτημα. Οι καλλιτέχνες φοβούνται να εκφράσουν την άποψή τους, φοβούμενοι τις αντιδράσεις και τις συνέπειες από τα μέσα μαζικής ενημέρωσης και τους ηθικολόγους. Όπως λέει ο Έθισμος: "Φοβόμαστε τι θα πούμε, πώς θα ακουστούμε, μετράμε τις βρισιές γιατί μπορεί οι ηθικολόγοι να μας την πούνε."⁠\n⁠\n🎤 Το φαινόμενο αυτό είναι παγκόσμιο, με εξαιρέσεις βέβαια να σπάνε τον κανόνα, όπως το τραγούδι "Hinds Hall" του Macklemore, που επίσης αναφέρεται στην αδικία και τη βία που επικρατεί στην Παλαιστίνη, αναδεικνύοντας τη σιωπή και την αποσιώπηση που κυριαρχούν στη μουσική βιομηχανία.⁠\n⁠\n💬 "Τελικά, δύο μέτρα και δύο σταθμά, δεν παίρνουν θέση τα τραγούδια μας γίναν συστημικά.", γράφει ο Εθισμός και αναρωτιόμαστε αφού η μουσική έχει τη δύναμη να ενώσει, να ευαισθητοποιήσει και να προκαλέσει αλλαγή, σαν την ελάχιστη δυνατή φωνή και αλληλεγύη στην γενοκτονία του Παλαιστινιακού λαού, γιατί δεν το κάνει;⁠\n⁠\n#itsestellacom #ethismos #ath #ethismosath #maclemore #hindshall #palestine #freepalestine #gaza #rafah #genocide #onlinemagazine #greece⁠',
